import Link from 'zeit/Link';
import withLayout from "./Layout"


const PostArticle = () => {
  return (
    <li>
      <ul>
        <Link href={`/post?title=${props.title}`}>
          <a>{props.title}</a>
        </Link>
      </ul>
    </li>

  )
}

export default withLayout(PostArticle);
